  \"2016-01-09T14:16:57.525521\",\n\t\"name\": \"american-samoa-longline-fishery-trip-expenditure-2006-to-present\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a time-series dataset for trip
  expenditure data for the American Samoa-based longline fleet from August 2006 to
  present. The dataset includes 10 variable cost items commonly associated with longline
  trips (not including labor costs). The cost items collected are: unit price, quantity
  used, and total cost estimates for diesel fuel, engine oil, bait, ice; and total
  cost estimates for gear, provisions, and communications. Additional information
  about the operator and crew are also included.  These data are collected on a routine
  basis through a collaboration between the Pacific Islands Fisheries Science Center
  (PIFSC) Economics Program and Pacific Islands Regional Office (PIRO) Observer Program.
